description:
In Aztec you are Coya, an eagle warrior who was looking for his monkey friend. 

But suddenly, someone mysteriously steals the mystic emerald which controls the nature of animals and leaves them with a very aggressive behavior. Now it's up to Coya rescue the emerald and make everything back to normal

